window.bookSummaryJSON = "<p>She’s a human. Forbidden. My brother’s widow. But deep down, my wolf believes she's mine. <br> <br> Before my brother died, he made me swear to stand by his human mate and their son. It's been 10 years since his death, and I've done my best. I joined the military, got my sh*&amp; straight.<br> <br> I sent money, but stayed away from Julia and my nephew. Stayed out of their life. She didn't need a screw-up like me hanging around.<br> <br> That was the lie I told myself. The truth was, I couldn’t resolve my attraction to her. And I can't dishonor my brother's memory by claiming his wife.<br> <br> But now her pup has entered puberty. He’s become a wolf. He needs me there to guide and protect him.<br> <br> Julia hasn't forgiven me for the years I stayed away, but this time I'll do right by her. I’d do anything for the two of them.<br> <br> But she’s the one I want to guide. Protect. Command. She’s the one I crave, and will until my last breath.</p> <p>Don't miss the next installment of Renee Rose and Lee Savino's <i>USA Today </i>best-selling Shifter Ops series in which Channing meets his forbidden mate. Overprotective wolf shifter guaranteed.</p>"; 
